import Expense from './ExpensesAndCheckboxes/Expense'
import MainTable from '/MainTable.css'

const Expenses = (props) => {
    return (
        <div>
            {props.expenses.map((expense) => (
                <tr>
                    <Expense 
                        name={expense.name} 
                        cost={expense.cost}
                    />
                </tr>
            ))}
        </div>
    )
}

export default Expenses;
